import { useParams } from 'react-router-dom';
import image from './images/im8.jpg';
import { useEffect, useState } from 'react';
import { toast } from 'react-toastify';
import {  editbranchDetails } from "./services/branch";


function Edit()
{
    const [branch, setbranch]=useState({branchName:"", branchCode:"",branchLocation:"",branchManager:""});
   const [branchId] = useParams;
   const [branchName, setBranchName] = useState("");
   const [branchCode, setBranchCode] = useState("");
   const [branchLocation, setBranchLocation] = useState("");
   const [branchManager, setBranchManager] = useState("");

const getBranchDetailsToEdit= async (branchId)=>
{
    de
    const response = await editbranchDetails(branchId);
    if(response!==null){
      setbranch(response);
    }
    else{
        toast.error("branch not found");
        }
}

    useEffect(()=>{
        getBranchDetailsToEdit(branchId)
    },[])
    return(

          <div style={{backgroundImage:`url(${image})`}} >
              <div className="lengths">
            <div>

            </div>
            <center>
            <table className='b'>
                        <tr>
                            <td>
                                Enter Branch Name
                            </td>
                            <td className='td'></td>
                            <td>
                               <input type="text" placeholder='Branch Name' value={branch.branchName}  onChange={(e) => {
                      setBranchName(e.target.value);
                    }}></input>
                            </td>
                        </tr><tr className='tr'>

                        </tr>
                        <tr>
                            <td>
                                Enter Branch Location
                            </td>
                            <td className='td'></td>
                            <td>
                               <input type="text" placeholder='Branch Location' value={branch.branchLocation}  onChange={(e) => {
                      setBranchLocation(e.target.value);
                    }}></input>
                            </td>
                        </tr><tr className='tr'>

                        </tr>
                        <tr>
                            <td>
                                Enter Branch Code
                            </td>
                            <td className='td'></td>
                            <td>
                               <input type="text" placeholder='Branch Code' value={branch.branchCode}  onChange={(e) => {
                      setBranchCode(e.target.value);
                    }}></input>
                            </td>
                        </tr><tr className='tr'>

                        </tr>
                        <tr>
                            <td>
                                Enter Branch Manager
                            </td>
                            <td className='td'></td>
                            <td>
                               <input type="text" placeholder='Branch Manager' value={branch.branchManager}>  onChange={(e) => {
                      setBranchManager(e.target.value);
                    }}</input>
                            </td>
                        </tr><tr className='tr'>

                        </tr>
                        <tr>
                            <center>
                                <td>
                                    <button className='btn btn-primary' >Add Branch</button>
                                </td>
                            </center>
                        </tr>

                    </table>
                    </center>
          </div>
        </div>
        )
}
export default Edit;
